import React from 'react'
import { useSelector } from 'react-redux'
import { sidebarLinks } from '../../../data/dashboard-links';
import { Link } from 'react-router-dom';
import { ConfirmationModel } from '../../common/ConfirmationModel';
import { useState } from 'react';
export const MyProfile = () => {
const {user}=useSelector((state)=>state.profile);
const {token}=useSelector((state)=>state.auth);
const [confirmationModel,setConfirmationModel]=useState(false);
  return (
    <div>
        <div>
            {
                sidebarLinks.map((link,index)=>{
                    return (
                        <div key={index}>{user?.accountType==link.type && <Link to={link.path}>{link.name}</Link>} </div>
                    );
                })
            }
            <Link to='/setting'>Setting</Link>
            <br></br>
            <button onClick={()=>setConfirmationModel(true)}>Loggout</button>
            <ConfirmationModel setConfirmationModel={setConfirmationModel} confirmationModel={confirmationModel}/>
        </div>
            <hr></hr>
        <div>
            My Profile
            <img src={user?.image} width="20px" height="20px"></img>
            <div>{user?.firstName}</div>
            <div>{user?.lastName}</div>
            <div>{user?.email}</div>
            <Link to='/setting'>Edit</Link>
            <hr></hr>
            <div>Personal Details</div>
            <Link to='/setting'>Edit</Link>
            
        </div>


    </div>
  )
}
